function Navbar() {
    return (
        <nav class="navbar">
            <div>
                <button onClick={playVideo}>Play</button>
                <button onClick={pauseVideo}>Pause</button>
                <button onClick={stopVideo}>Stop</button>
                <button onClick={() => seekTo(60)}>Seek to 1:00</button>
            </div>
        </nav>
    );
}

export default Navbar;
